Turbofan_TASOPTc::Turbofan_TASOPTc(void){
    
    //cout<<" Initializing C++ based propulsion model"<<endl;
    number_of_engines = 1;
    max_iters         = 40; //200; //1;
    newton_relaxation = 1.0;
    cooling_flow      = 0;
    dp = new engine_parameters;
    odp_b = new engine_parameters;
    dp_temp = new engine_parameters;
}


    
void Turbofan_TASOPTc::unpack(){

    //design parameters---------------------------------------
    
    dp->Pt5     = 1.0;
    dp->M2      = 0.6;
    dp->M2_5    = 0.6;
    
    dp->Tref    = 288.15;
    dp->Pref    = 101325.0;
    
    dp->GF      = 1.0;
    dp->N_spec   = 1.0;
    dp->Tt4_Tt2  = 1.0;
    
    //offdesign parameters---------------------------------------
    
    odp_b->aalpha  = dp->aalpha; //self.bypass_ratio
    
    odp_b->pi_d    = dp->pi_d; //self.inlet_nozzle.pressure_ratio
    odp_b->eta_d   = dp->eta_d; //self.inlet_nozzle.polytropic_efficiency
    
    odp_b->pi_f    = dp->pi_f; //self.fan.pressure_ratio
    odp_b->eta_f   = dp->eta_f; //self.fan.polytropic_efficiency
    
    odp_b->pi_fn   = dp->pi_fn; //self.fan_nozzle.pressure_ratio
    odp_b->eta_fn  = dp->eta_fn; //self.fan_nozzle.polytropic_efficiency
    
    odp_b->pi_lc   = dp->pi_lc; //self.low_pressure_compressor.pressure_ratio
    odp_b->eta_lc  = dp->eta_lc; //self.low_pressure_compressor.polytropic_efficiency
    
    odp_b->pi_hc   = dp->pi_hc; //self.high_pressure_compressor.pressure_ratio
    odp_b->eta_hc  = dp->eta_hc; //self.high_pressure_compressor.polytropic_efficiency
    
    odp_b->Tt4     = dp->Tt4; //self.combustor.turbine_inlet_temperature
    odp_b->pi_b    = dp->pi_b; //self.combustor.pressure_ratio
    odp_b->eta_b   = dp->eta_b; //self.combustor.efficiency
    odp_b->htf     = dp->htf; //self.combustor.fuel_data.specific_energy
    
    odp_b->eta_lt  = dp->eta_lt; //self.low_pressure_turbine.polytropic_efficiency
    odp_b->etam_lt = dp->etam_lt; //self.low_pressure_turbine.mechanical_efficiency
    
    odp_b->eta_ht  = dp->eta_ht; //self.high_pressure_turbine.polytropic_efficiency
    odp_b->etam_ht = dp->etam_ht; //self.high_pressure_turbine.mechanical_efficiency
    
    odp_b->pi_tn   = dp->pi_tn; //self.core_nozzle.pressure_ratio
    odp_b->eta_tn  = dp->eta_tn; //self.core_nozzle.polytropic_efficiency
    
    
    odp_b->Pt5     = 1.0;
    odp_b->M2      = 0.6;
    odp_b->M2_5    = 0.6;
    
    odp_b->HTR_f   = dp->HTR_f; //self.fan.hub_to_tip_ratio
    odp_b->HTR_hc  = dp->HTR_hc; //self.high_pressure_compressor.hub_to_tip_ratio
    
    odp_b->Tref    = 288.15;
    odp_b->Pref    = 101325.0;
    
    odp_b->GF      = 1.0;
    odp_b->N_spec   = 1.0;
    odp_b->Tt4_Tt2  = 1.0;
    
    
    
    
    dp_temp->aalpha  = dp->aalpha; //self.bypass_ratio
    
    dp_temp->pi_d    = dp->pi_d; //self.inlet_nozzle.pressure_ratio
    dp_temp->eta_d   = dp->eta_d; //self.inlet_nozzle.polytropic_efficiency
    
    dp_temp->pi_f    = dp->pi_f; //self.fan.pressure_ratio
    dp_temp->eta_f   = dp->eta_f; //self.fan.polytropic_efficiency
    
    dp_temp->pi_fn   = dp->pi_fn; //self.fan_nozzle.pressure_ratio
    dp_temp->eta_fn  = dp->eta_fn; //self.fan_nozzle.polytropic_efficiency
    
    dp_temp->pi_lc   = dp->pi_lc; //self.low_pressure_compressor.pressure_ratio
    dp_temp->eta_lc  = dp->eta_lc; //self.low_pressure_compressor.polytropic_efficiency
    
    dp_temp->pi_hc   = dp->pi_hc; //self.high_pressure_compressor.pressure_ratio
    dp_temp->eta_hc  = dp->eta_hc; //self.high_pressure_compressor.polytropic_efficiency
    
    dp_temp->Tt4     = dp->Tt4; //self.combustor.turbine_inlet_temperature
    dp_temp->pi_b    = dp->pi_b; //self.combustor.pressure_ratio
    dp_temp->eta_b   = dp->eta_b; //self.combustor.efficiency
    dp_temp->htf     = dp->htf; //self.combustor.fuel_data.specific_energy
    
    dp_temp->eta_lt  = dp->eta_lt; //self.low_pressure_turbine.polytropic_efficiency
    dp_temp->etam_lt = dp->etam_lt; //self.low_pressure_turbine.mechanical_efficiency
    
    dp_temp->eta_ht  = dp->eta_ht; //self.high_pressure_turbine.polytropic_efficiency
    dp_temp->etam_ht = dp->etam_ht; //self.high_pressure_turbine.mechanical_efficiency
    
    dp_temp->pi_tn   = dp->pi_tn; //self.core_nozzle.pressure_ratio
    dp_temp->eta_tn  = dp->eta_tn; //self.core_nozzle.polytropic_efficiency
    
    
    dp_temp->Pt5     = 1.0;
    dp_temp->M2      = 0.6;
    dp_temp->M2_5    = 0.6;
    
    dp_temp->HTR_f   = dp->HTR_f; //self.fan.hub_to_tip_ratio
    dp_temp->HTR_hc  = dp->HTR_hc; //self.high_pressure_compressor.hub_to_tip_ratio
    
    dp_temp->Tref    = 288.15;
    dp_temp->Pref    = 101325.0;
    
    dp_temp->GF      = 1.0;
    dp_temp->N_spec   = 1.0;
    dp_temp->Tt4_Tt2  = 1.0;
    

}





//sizing function to size the engine
void Turbofan_TASOPTc::size(double Ms,double Ps,double Ts, double throttle, double design_thrust, int no_engines){
    
    number_of_engines = no_engines;
    total_design_thrust = design_thrust;
    double P_sls,T_sls,design_outputs[5],sls_values[5];
    evaluate(Ms,Ps,Ts,throttle,0,design_outputs,dp);
    P_sls = 101325;
    T_sls = 288.15;
    
    fan_diameter = dp->d_fan;
    
    //cout<<"Design conditions : "<<design_outputs[0]<<" "<<design_outputs[1]<<endl;
    
    offdesign(0.0,P_sls,T_sls,1.0);
    
    
    sls_thrust = Thrust_fin;
    sls_sfc = sfc_fin;
    
    //cout<<" Done with sizing : "<<endl;
    
}




void Turbofan_TASOPTc::offdesign(double M,double P,double T,double throttle){
    
    double offdesign_outputs[5];
    mat J;
    vec R,d_bp;
    J.set_size(8,8);
    R.set_size(8);
    //d_bp.set_size(8);
    //bp.set_size(8);
    
    //cout<<" Offdesign "<<endl;
    
    reset_baseline_params();
    evaluate(M,P,T,throttle,1.0,offdesign_outputs,odp_b);
    set_baseline_params(bp);
    
    //cout<<"\n"<<offdesign_outputs[0]<<" "<<offdesign_outputs[1]<<" "<<offdesign_outputs[2];
    //cout<<"\n Res : "<<odp_b->Res[0]<<" "<<odp_b->Res[1]<<" "<<odp_b->Res[2]<<" "<<odp_b->Res[3]<<" "<<odp_b->Res[4]<<" "<<odp_b->Res[5]<<" "<<odp_b->Res[6]<<" "<<odp_b->Res[7]<<endl;
    
    //cout<<odp_b->norm_R<<" ";
    
    if(odp_b->norm_R>1e-8){

            for (int iiter=0; iiter<max_iters; iiter++){
                
                jacobian_fd(bp,M,P,T,throttle);
                
                
                for (int i=0;i<8;i++){
                    for (int j=0;j<8;j++){
                        J(i,j)=Jac[i][j];
                        //cout<<J(i,j)<<" "<<Jac[i][j]<<"   ";
                    }
                    //cout<<endl;
                    R(i) = odp_b->Res[i];
                }
                
                //cout<<"\n Jac : "<<J<<endl;
                //cout<<"\n Res : "<<R<<endl;
                
                //d_bp = -np.linalg.solve(J, Res);
                d_bp = solve(J,R); //minus 1 moved to next step
                
                //cout<<"\n d_bp : "<<d_bp<<endl;
                
                for(int i=0;i<8;i++){
                    bp[i] = bp[i] - newton_relaxation*d_bp(i);
                }
                
                update_baseline_params(bp);
                evaluate(M,P,T,throttle,1.0,offdesign_outputs,odp_b);
                //cout<<iiter<<" "<<offdesign_outputs[0]<<" "<<offdesign_outputs[1]<<" "<<offdesign_outputs[2]<<endl;
                
                
                if(odp_b->norm_R<1e-6){
                    break;
                }

            }
    }
    
//    outputs[0] = offdesign_outputs[0];
//    outputs[1] = offdesign_outputs[1];
//    outputs[2] = offdesign_outputs[2];
//    outputs[3] = offdesign_outputs[3];
//    outputs[4] = offdesign_outputs[4];
    
    Thrust_fin = offdesign_outputs[2];
    sfc_fin = offdesign_outputs[1];
    mdot_fin = offdesign_outputs[3];
    
    
}




