void Turbofan_TASOPTc::evaluate(double M0,double P0,double T0,double throttle,int flag, double * outputs, engine_parameters * odp){
    
    double gamma,Cp,R,g,pi,N_spec;
    double Nln,Nhn,Nfn,dNln_pilc,dNln_mlc,dNhn_pihc,dNhn_mhc,dNfn_pif,dNfn_mf;
    double performance_values[4];
    double ht4,f,Pt4,Tt4_1,Pt4_1,ht4_1,mcore,mfan,deltah_ht,Tt4_5,Pt4_5,ht4_5,deltah_lt,Tt4_9,Pt4_9,ht4_9,pi_lt,Pt5,Tt5,ht5;
    double a0,u0,Tt0,Pt0,ht0,h0,Pt1_8,Tt1_8,ht1_8,Pt1_9,Tt1_9,ht1_9,Pt2,Tt2,ht2,Pt2_1,Tt2_1,ht2_1;
    double Pt7,Tt7,ht7,Pt2_5,Tt2_5,ht2_5,Pt3,Tt3,ht3;
    double Pt6,Tt6,ht6,P6,T6,h6,u6,Pt8,Tt8,ht8,P8,T8,h8,u8,Fsp,Isp,TSFC,FD,F,mdot,mdot_core,T2,P2,h2,rho2,u2,A2,df2;
    double T2_5,P2_5,h2_5,rho2_5,u2_5,A2_5,df2_5,M8,P7,M7,T7,h7,u7,rho7,A7, M6, P5,M5,T5,h5,u5,rho5,A5;
    double NlcD,NhcD,NlD,NhD,mhtD,mltD,mhcD,mlcD,mfD;
    
    
    gamma = 1.4;
    Cp    = 1.4*287.87/(1.4-1);
    R     = 287.87;
    g     = 9.81;
    pi    = 22/7;
    N_spec  = throttle;
    odp->N_spec = throttle;
    
    if(flag == 1){
        //lpc
        performance(odp->pi_lc,odp->mlc,0,performance_values);
        Nln = performance_values[0];
        odp->eta_lc = performance_values[1];
        dNln_pilc = performance_values[2];
        dNln_mlc = performance_values[3];
        
        //hpc
        performance(odp->pi_hc,odp->mhc,1,performance_values);
        Nhn = performance_values[0];
        odp->eta_hc = performance_values[1];
        dNhn_pihc = performance_values[2];
        dNhn_mhc = performance_values[3];
        
        //fpc
        performance(odp->pi_f,odp->mf,2,performance_values);
        Nfn = performance_values[0];
        odp->eta_f = performance_values[1];
        dNfn_pif = performance_values[2];
        dNfn_mf = performance_values[3];
    }
    

    
    a0 = sqrt(gamma*R*T0);
    u0 = M0*a0;
    
    //freestream stagnation properties
    Tt0 = Tt(M0, T0, gamma);
    Pt0 = Pt(M0, P0, gamma);
    ht0 = Cp*Tt0;
    h0  = Cp*T0;
    
    //inlet conditions
    Pt1_8 = Pt0*odp->pi_d;
    Tt1_8 = Tt0;
    ht1_8 = ht0;
    
    Pt1_9 = Pt1_8;
    Tt1_9 = Tt1_8;
    ht1_9 = ht1_8;
    
    //fan and lpc inlet
    Pt2 = Pt1_9;
    Tt2 = Tt1_9;
    ht2 = ht1_9;
    
    
    //fan
    Pt2_1 = Pt2*odp->pi_f;
    Tt2_1 = Tt2*pow(odp->pi_f,(gamma-1.0)/(gamma*odp->eta_f)); //dp->pi_f^((gamma-1.)/(gamma*odp->eta_f));
    ht2_1 = Cp*Tt2_1;
    
    //fan nozzle
    Pt7 = Pt2_1*odp->pi_fn;
    Tt7 = Tt2_1*pow(odp->pi_fn,(gamma-1.0)*odp->eta_fn/(gamma)); //odp->pi_fn^((gamma-1.)*odp->eta_fn/(gamma));
    ht7 = Cp*Tt7;
    
    //low pressure compressor
//    Pt2_5 = Pt2_1*odp->pi_lc;
//    Tt2_5 = Tt2_1*pow(odp->pi_lc,(gamma-1.0)/(gamma*odp->eta_lc)); //odp->pi_lc^((gamma-1.)/(gamma*odp->eta_lc));
    
    Pt2_5 = Pt2*odp->pi_lc;
    Tt2_5 = Tt2*pow(odp->pi_lc,(gamma-1.0)/(gamma*odp->eta_lc)); //odp->pi_lc^((gamma-1.)/(gamma*odp->eta_lc));
    ht2_5 = Cp*Tt2_5;
    
    //high pressure compressor
    Pt3 = Pt2_5*odp->pi_hc;
    Tt3 = Tt2_5*pow(odp->pi_hc,(gamma-1.)/(gamma*odp->eta_hc));  //odp->pi_hc^((gamma-1.)/(gamma*odp->eta_hc));
    ht3 = Cp*Tt3;
    
//    cout<<" "<<T0<<" "<<P0<<" "<<M0<<endl;
//    cout<<" "<<Pt2<<" "<<Tt2<<" "<<Pt2_1<<" "<<Tt2_1<<" "<<Pt7<<" "<<Tt7<<" "<<Pt2_5<<" "<<Tt2_5<<" "<<Tt3<<" "<<Pt3<<endl;
//    cout<<" "<<odp->pi_lc<<" "<<odp->pi_hc<<" "<<odp->pi_f<<" "<<endl;
//    
//    if(flag==1){
//        cout<<" "<<odp->mlc<<" "<<odp->mhc<<" "<<odp->mf<<endl;
//        cout<<" "<<Nln<<" "<<odp->eta_lc<<" "<<Nhn<<" "<<odp->eta_hc<<" "<<Nfn<<" "<<odp->eta_f<<endl;
//    }
    

    
    if(cooling_flow == 0){
        
        //combustor
        ht4  = Cp*odp->Tt4;
        f    = (ht4 - ht3)/(odp->eta_b*odp->htf-ht4);
        Pt4  = Pt3*odp->pi_b;
        
        Tt4_1 = odp->Tt4;
        Pt4_1 = Pt4;
        ht4_1 = Cp*Tt4_1;
    }
    
    
    
    //update the bypass ratio
    if (flag == 1){
        //mcore = odp->mlc*(Pt2_1/odp->Pref)/sqrt(Tt2_1/odp->Tref)/(1.0 + f);
        mcore = odp->mlc*(Pt2/odp->Pref)/sqrt(Tt2/odp->Tref)/(1.0 + f);
        mfan  = odp->mf*(Pt2/odp->Pref)/sqrt(Tt2/odp->Tref)/(1.0 + f);
        odp->aalpha = mfan/mcore;
    }
    
    
    
    //high pressure turbine
    deltah_ht = -1.0/(1.0+f)*1.0/odp->etam_ht*(ht3-ht2_5);
    Tt4_5     = Tt4_1 + deltah_ht/Cp;
    Pt4_5     = Pt4_1*pow(Tt4_5/Tt4_1,gamma/((gamma-1.0)*odp->eta_ht));  //(Tt4_5/Tt4_1)^(gamma/((gamma-1.)*odp->eta_ht));
    ht4_5     = ht4_1 + deltah_ht;
    
    if(flag == 0){
        
        //low pressure turbine
        //deltah_lt =  -1.0/(1.0+f)*1.0/odp->etam_lt*((ht2_5 - ht2_1)+ odp->aalpha*(ht2_1 - ht2));
        deltah_lt =  -1.0/(1.0+f)*1.0/odp->etam_lt*((ht2_5 - ht1_9)+ odp->aalpha*(ht2_1 - ht2));
        Tt4_9     = Tt4_5 + deltah_lt/Cp;
        Pt4_9     = Pt4_5*pow(Tt4_9/Tt4_5,gamma/((gamma-1.0)*odp->eta_lt)); //(Tt4_9/Tt4_5)^(gamma/((gamma-1.)*odp->eta_lt));
        ht4_9     = ht4_5 + deltah_lt;
    }
    else{
        
        pi_lt = 1.0/odp->pi_tn*(odp->Pt5/Pt4_5);
        Pt4_9 = Pt4_5*pi_lt;
        Tt4_9 = Tt4_5*pow(pi_lt,(gamma-1.0)*odp->eta_lt/(gamma)); // pi_lt^((gamma-1.)*odp->eta_lt/(gamma));
        ht4_9 = Cp*Tt4_9;
    }
    
//    cout<<" aalpha : "<<odp->Tt4<<" "<<Tt4_1<<" "<<f<<" "<<odp->aalpha<<" "<<Tt4_5<<" "<<Pt4_5<<" "<<Tt4_9<<" "<<Pt4_9<<endl;
    
    //turbine nozzle
    Pt5 = Pt4_9*odp->pi_tn;
    Tt5 = Tt4_9;
    ht5 = ht4_9;
    

    
    //core exhaust
    Pt6 = Pt5;
    Tt6 = Tt5;
    ht6 = Cp*Tt6;
    
    P6 = Pt6*(P0/Pt6);
    T6 = Tt6*pow(P0/Pt6,(gamma-1.0)/(gamma)); //(P0/Pt6)^((gamma-1.)/(gamma));
    h6 = Cp*T6;
    
    if(Tt6<T6){
        M6 = 1.0;
        T6 = Tt6/(1+0.2*pow(M6,2.0));
        u6 = M6*sqrt(gamma*R*T6);
    }
    else{
        u6 = sqrt(2.0*(ht6-h6));
    }
    
    //fan exhaust
    Pt8 = Pt7;
    Tt8 = Tt7;
    ht8 = Cp*Tt7;
    
    P8 = Pt8*(P0/Pt8);
    T8 = Tt8*pow(P0/Pt8,(gamma-1.0)/(gamma)); //(P0/Pt8)^((gamma-1.)/(gamma));
    h8 = Cp*T8;
    u8 = sqrt(2.0*(ht8-h8));
    
    
    //overall quantities
    Fsp = ((1.0+f)*u6 - u0 + odp->aalpha*(u8-u0))/((1.0+odp->aalpha)*a0);
    Isp = Fsp/f*a0/g*(1.0+odp->aalpha);
    
    TSFC = 3600.0/Isp;  //1./Isp
    
    //cout<<" Fsp : "<<Fsp<<" "<<u8<<" "<<Pt8<<" "<<Tt8<<" "<<Pt6<<" "<<Tt6<<" "<<u6<<endl;
    
    if(flag==0){
        
        //run sizing analysis
        FD = total_design_thrust/number_of_engines;
        F    = Fsp;
        mdot = 1.0;
        
        //core mass flow computation
        mdot_core = FD/(Fsp*a0*(1.0+odp->aalpha));
        
        //fan area sizing
        T2 = Tt_inv(odp->M2, Tt2, gamma);
        P2 = Pt_inv(odp->M2, Pt2, gamma);
        h2 = Cp*T2;
        rho2 = P2/(R*T2);
        u2 = odp->M2*sqrt(gamma*R*T2);
        A2 = (1.0+odp->aalpha)*mdot_core/(rho2*u2);
        
        df2 = sqrt(4.0/pi*A2/(1.0-pow(odp->HTR_f,2.0)));
        
    
        
        //HP compressor area
        T2_5 = Tt_inv(odp->M2_5, Tt2_5, gamma);
        P2_5 = Pt_inv(odp->M2_5, Pt2_5, gamma);
        h2_5 = Cp*T2_5;
        rho2_5 = P2_5/(R*T2_5);
        u2_5 = odp->M2_5*sqrt(gamma*R*T2_5);
        A2_5 = (1.0+odp->aalpha)*mdot_core/(rho2_5*u2_5);
        
        df2_5 = sqrt(4.0/pi*A2_5/(1.0-pow(odp->HTR_hc,2)));
        
        
        //fan nozzle area
        M8 = u8/sqrt(gamma*R*T8);
        
        if(M8<1){
            P7 = P0;
            M7 = sqrt(((pow(Pt7/P7,(gamma-1.0)/gamma))-1.0)*2.0/(gamma-1.0));
            //M7 = sqrt((((Pt7/P7)^((gamma-1.)/gamma))-1.)*2./(gamma-1.));
        }
        else{
            M7 = 1.0;
            P7 = Pt7/pow(1.0+(gamma-1.0)/2.0*pow(M7,2.0),gamma/(gamma-1.0));
            //P7 = Pt7/(1.+(gamma-1.)/2.*M7^2.)^(gamma/(gamma-1.));
        }
        
        
        T7 = Tt7/(1.0+(gamma-1.0)/2.0*pow(M7,2.0));
        h7 = Cp*T7;
        u7 = sqrt(2.0*(ht7-h7));
        rho7 = P7/(R*T7);
        A7   = odp->aalpha*mdot_core/(rho7*u7);
        
        
        //core nozzle area
        M6 = u6/sqrt(gamma*R*T6);
        
        if(M6<1.0){
            P5 = P0;
            M5 = sqrt((pow(Pt5/P5,(gamma-1.0)/gamma)-1.0)*2.0/(gamma-1.0));
        }
        else{
            M5 = 1.0;
            P5 = Pt5/pow(1.0+(gamma-1.0)/2.0*pow(M5,2.0),gamma/(gamma-1.0));
        }
        
        
        T5 = Tt5/(1.0+(gamma-1.0)/2.0*pow(M5,2.0));
        h5 = Cp*T5;
        u5 = sqrt(2.0*(ht5-h5));
        rho5 = P5/(R*T5);
        A5   = mdot_core/(rho5*u5);
        
        
        
        
        //spool speed
        
        NlcD = 1.0;
        NhcD = 1.0;
        
        //non dimensionalization
        
        //NlD = NlcD*1.0/sqrt(Tt2_1/odp->Tref);
        NlD = NlcD*1.0/sqrt(Tt1_9/odp->Tref);
        NhD = NhcD*1.0/sqrt(Tt2_5/odp->Tref);
        
        mhtD = (1.0+f)*mdot_core*sqrt(Tt4_1/odp->Tref)/(Pt4_1/odp->Pref);
        mltD = (1.0+f)*mdot_core*sqrt(Tt4_5/odp->Tref)/(Pt4_5/odp->Pref);
        
        mhcD = (1.0+f)*mdot_core*sqrt(Tt2_5/odp->Tref)/(Pt2_5/odp->Pref);
        mlcD = (1.0+f)*mdot_core*sqrt(Tt2/odp->Tref)/(Pt2/odp->Pref);
        //mlcD = (1.0+f)*mdot_core*sqrt(Tt2_1/odp->Tref)/(Pt2_1/odp->Pref);
        mfD  = (1.0+f)*odp->aalpha*mdot_core*sqrt(Tt2/odp->Tref)/(Pt2/odp->Pref);
        
        
        
        dp->A5   = A5;
        dp->A7   = A7;
        dp->A2   = A2;
        dp->A2_5 = A2_5;
        
        
        dp->mhtD = mhtD;
        dp->mltD = mltD;
        
        dp->mhcD = mhcD;
        dp->mlcD = mlcD;
        dp->mfD  = mfD;
        
        dp->NlcD = NlcD;
        dp->NhcD = NhcD;
        dp->NlD  = NlD;
        dp->NhD  = NhD;
        
        dp->mhtD = mhtD;
        dp->mltD = mltD;
        
        
        //update the offdesign params
        dp->mhc = mhcD;
        dp->mlc = mlcD;
        dp->mf  = mfD;
        
        dp->Nl = NlcD;
        dp->Nh = NhcD;
        dp->Nf  = 1.0;
        
        dp->Nln  = NlD;
        dp->Nhn  = NhD;
        dp->Nfn  = NlD;
        
        dp->Pt5  = Pt5;
        dp->Tt4_Tt2 = odp->Tt4/Tt2;
        dp->d_fan = df2;
        
        
    }
    
    else{
        
        odp->Tt3 = Tt3;
        odp->Pt3 = Pt3;
        
        //lpc
        //odp->Nl = sqrt(Tt2_1/odp->Tref)*Nln;
        odp->Nl = sqrt(Tt2/odp->Tref)*Nln;
        
        //hpc
        odp->Nh = sqrt(Tt2_5/odp->Tref)*Nhn;
        
        //fpc
        odp->Nf = sqrt(Tt1_9/odp->Tref)*Nfn;
        
        if(flag == 1){
            odp->Tt4_spec = odp->Tt4_Tt2*Tt2*throttle;
            //dp->Tt4_spec = 2000.
        }
        
        
        
        //mdot_core = odp->mlc*Pt2_1/odp->Pref/sqrt(Tt2_1/odp->Tref);
        mdot_core = odp->mlc*Pt2/odp->Pref/sqrt(Tt2/odp->Tref);
        Fsp = ((1.0+f)*u6 - u0 + odp->aalpha*(u8-u0))/((1.0+odp->aalpha)*a0);
        
        Isp  = Fsp*a0*(1.0+odp->aalpha)/(f*g);
        TSFC = 3600.0/(Isp);
        F    = Fsp*(1.0+odp->aalpha)*mdot_core*a0;
        mdot = mdot_core*f;
        
        odp->mdot_core = mdot_core;
        //compute dp->M2
        
        //fan area sizing
        T2 = Tt_inv(odp->M2, Tt2, gamma);
        P2 = Pt_inv(odp->M2, Pt2, gamma);
        h2 = Cp*T2;
        rho2 = P2/(R*T2);
        u2 = odp->M2*sqrt(gamma*R*T2);
        
        
        //HP compressor area
        T2_5 = Tt_inv(odp->M2_5, Tt2_5, gamma);
        P2_5 = Pt_inv(odp->M2_5, Pt2_5, gamma);
        h2_5 = Cp*T2_5;
        rho2_5 = P2_5/(R*T2_5);
        u2_5 = odp->M2_5*sqrt(gamma*R*T2_5);
        
//        cout<<" mdot : "<<mdot_core<<" "<<Fsp<<" "<<Isp<<" "<<F<<" "<<mdot<<" "<<u2<<" "<<u2_5;
        
        //fan nozzle area
        M8 = u8/sqrt(gamma*R*T8);
        
        if(M8<1.0){
            P7 = P0;
            M7 = sqrt((pow(Pt7/P7,(gamma-1.0)/gamma)-1.0)*2.0/(gamma-1.0));
        }
        else{
            M7 = 1.0;
            P7 = Pt7/pow(1.0+(gamma-1.0)/2.0*pow(M7,2.0),gamma/(gamma-1.0));
        }
        
        
        T7 = Tt7/(1.0+(gamma-1.0)/2.0*pow(M7,2.0));
        h7 = Cp*T7;
        u7 = sqrt(2.0*(ht7-h7));
        rho7 = P7/(R*T7);
        
        
        //core nozzle area
        M6 = u6/sqrt(gamma*R*T6);
        
        int testval;
        
        if(M6<1.0){
            P5 = P0;
            M5 = sqrt((pow(Pt5/P5,(gamma-1.0)/gamma)-1.0)*2.0/(gamma-1.0));
            //cout<<"t0 : "<<M6<<" "<<Tt6-T6<<" "<<M5<<" "<<P5<<endl;
        }
        else{
            M5 = 1.0;
            P5 = Pt5/pow(1.0+(gamma-1.0)/2.0*pow(M5,2.0),gamma/(gamma-1.0));
            //cout<<"t1 : "<<M6<<" "<<Tt6-T6<<" "<<M5<<" "<<P5<<endl;
            testval = 1;
            
        }
        
        
        T5 = Tt5/(1.0+(gamma-1.0)/2.0*pow(M5,2.0));
        h5 = Cp*T5;
        u5 = sqrt(2.0*(ht5-h5));
        rho5 = P5/(R*T5);
        
        //cout<<"Offdesign value : "<<M6<<" "<<M5<<" "<<P5<<" "<<u5<<" "<<rho5<<" "<<testval<<endl;
        
        
        //compute offdesign residuals
        
        
        odp->Res[0] = (odp->Nf*odp->GF - odp->Nl); ///dp->Nl
        odp->Res[1] = ((1.0+f)*odp->mhc*sqrt(Tt4_1/Tt2_5)*Pt2_5/Pt4_1 - odp->mhtD);  ///dp->mhtD
        odp->Res[2] = ((1.0+f)*odp->mhc*sqrt(Tt4_5/Tt2_5)*Pt2_5/Pt4_5 - odp->mltD); ///dp->mltD
        odp->Res[3] = (odp->mf*sqrt(odp->Tref/Tt2)*Pt2/odp->Pref - rho7*u7*dp->A7);  ///(rho7*u7*dp->A7)
        odp->Res[4] = ((1.0+f)*odp->mhc*sqrt(odp->Tref/Tt2_5)*Pt2_5/odp->Pref - rho5*u5*dp->A5); ///rho5*u5*dp->A5
        //odp->Res[5] = (odp->mlc*sqrt(odp->Tref/Tt2_1)*Pt2_1/odp->Pref - odp->mhc*sqrt(odp->Tref/Tt2_5)*Pt2_5/odp->Pref); ///(dp->mhc*np.sqrt(dp->Tref/Tt2_5)*Pt2_5/dp->Pref)
        odp->Res[5] = (odp->mlc*sqrt(odp->Tref/Tt1_9)*Pt1_9/odp->Pref - odp->mhc*sqrt(odp->Tref/Tt2_5)*Pt2_5/odp->Pref); ///(dp->mhc*np.sqrt(dp->Tref/Tt2_5)*Pt2_5/dp->Pref)
        odp->Res[6] = (odp->Nl - odp->N_spec);  ///dp->Tt4
        
        //low pressure turbine
        //deltah_lt =  -1.0/(1.0+f)*1.0/odp->etam_lt*((ht2_5 - ht2_1)+ odp->aalpha*(ht2_1 - ht2));
        deltah_lt =  -1.0/(1.0+f)*1.0/odp->etam_lt*((ht2_5 - ht1_9)+ odp->aalpha*(ht2_1 - ht2));
        Tt4_9     = Tt4_5 + deltah_lt/Cp;
        Pt4_9     = Pt4_5*pow(Tt4_9/Tt4_5,(gamma/((gamma-1.0)*odp->eta_lt)));
        ht4_9     = ht4_5 + deltah_lt;
        
        
        
        odp->Res[7] = (odp->Pt5 - Pt4_9*odp->pi_tn);  ///dp->Pt5
        
        odp->norm_R = sqrt(odp->Res[0]*odp->Res[0] + odp->Res[1]*odp->Res[1] + odp->Res[2]*odp->Res[2] + odp->Res[3]*odp->Res[3] + odp->Res[4]*odp->Res[4] + odp->Res[5]*odp->Res[5]+ odp->Res[6]*odp->Res[6] + odp->Res[7]*odp->Res[7]);
        
        
        //cout<<"\n"<<f<<" "<<odp->mhc<<" "<<Tt4_1<<" "<<Tt2_5<<" "<<Pt2_5<<" "<<Pt4_1<<" "<<odp->mhtD<<endl;

        //cout<<Fsp<<" "<<F<<" "<<TSFC<<" "<<odp->Nf<<" "<<odp->Nl<<" "<<odp->Nh<<" "<<odp->mf/odp->mfD<<" "<<odp->mlc/odp->mlcD<<" "<<odp->mhc/odp->mhcD<<endl;
        
        //----------compute analytic jacobian---------------------------------------------------------
        //-----------------------------------------------------------------------------------
        
        
        //jacobian_an(gamma, R, Cp, P0, T0, M0, throttle, odp->pi_lc, odp->mlc, odp->pi_hc, odp->mhc, odp->pi_f, odp->mf, odp->pi_d, odp->pi_fn, odp->eta_fn, odp->pi_lc, odp->Tt4, odp->eta_b, odp->htf, odp->pi_b, odp->Pref, odp->Tref, odp->etam_ht, odp->eta_ht, odp->etam_lt, odp->aalpha, odp->eta_lt, odp->pi_tn, odp->Pt5, odp->Tt4_spec, odp->Tt4_Tt2, odp->M2, odp->M2_5, odp->GF, dp->mhtD, dp->mltD, dp->A7, dp->A5, odp->N_spec, Nln, Nhn, Nfn, odp->eta_lc, odp->eta_hc, odp->eta_f, M7, P7, M5, P5, dNln_pilc, dNln_mlc, dNfn_pif, dNfn_mf);
        
        //cout<<"\n"<<gamma<<" "<<R<<" "<<Cp<<" "<<P0<<" "<<T0<<" "<<M0<<" "<<throttle<<" ";
        //cout<<Nln<<" "<<Nhn<<" "<<Nfn<<" "<<M7<<" "<<P7<<" "<<M5<<P5<<" ";
        //cout<<dNln_pilc<<" "<<dNln_mlc<<" "<<dNfn_pif<<" "<<dNfn_mf;
        
        
        
        //jacobian_an(gamma, R, Cp, P0, T0, M0, throttle, Nln, Nhn, Nfn, M7, P7, M5, P5, dNln_pilc, dNln_mlc, dNfn_pif, dNfn_mf, M6, M8);
        
        
        //jacobian_an();
        
    }
    
    
    outputs[0] = Fsp;
    outputs[1] = TSFC;
    outputs[2] = F;
    outputs[3] = mdot;
    outputs[4] = mdot_core;
    
    
}








